/** calls Eyeota Cookieless sync endpoint. */
let start = Date.now();

function call_eyeota_idgraph_service(data){
  let end = Date.now();
  var url = "https://ps.eyeota.net/cross-device-match?gd_type=prebid&g_data=";

  var json = JSON.stringify(data);
  (new Image()).src = url + btoa(json);
  console.log(`prebid js processing time: ${end - start} ms`);
}

function execute_partner_js_prebid(gdprApplies,uspApplies) {
    const config = {
        // debug: true
    };
    const userIds = [{
        name: 'id5Id',
        params: {
            partner: 123,
            pd: ''
        },
        storage: {
            type: 'html5',
            name: 'id5id',
            expires: 90,
            refreshInSeconds: 8 * 3600
        }
    }];
    config.userSync = {userIds: userIds, auctionDelay: 250};

    if (gdprApplies) {
        config.consentManagement = {
            gdpr: {
                cmpApi: 'iab',
                timeout: 8000,
                defaultGdprScope: true,
            },
        }
    } else if (uspApplies) {
        config.consentManagement = {
            usp: {
                cmpApi: 'iab',
                timeout: 8000
               }
        }
    }

    eyewisePbjs.setConfig(config);

    eyewisePbjs.getUserIdsAsync().then(async function(userIds) {
        console.log(userIds);
        if (userIds.hasOwnProperty('id5id')) {
           var id5Id = userIds['id5id'].uid;
           var end = new Date().getTime();
           var latency = end-start;

           if (typeof id5Id == "undefined" || !(id5Id.startsWith('ID5*') || id5Id.startsWith('ID5-'))) {
             return;
          }
           var decryptedId5id = id5Id;
           if (id5Id.length >= 47 && id5Id[46] == "!") {
              decryptedId5id = id5Id.substring(0,46)
           }

           ids = [{ "id": decryptedId5id, "idType": "ID5_UNIVERSAL_ID"}];
           data = {"orgId": "oi0reav", "ids": ids, "latency": latency};
           call_eyeota_idgraph_service(data);
        }
    });
}

